e9e mondiale de l\u2019Ocean.\n\nL\u2019occasion de se rappeler \u00e0 quel point il est vital pour la plan\u00e8te \ud83c\udf0d... Chaque ann\u00e9e 8 millions de tonnes de plastique finissent par flotter sur l\u2019eau et 14 millions de tonnes jonchent actuellement le fond des oc\u00e9ans. D\u2019ici 2040 ces chiffres devraient tripler si nous n\u2019arr\u00eatons pas la machine. Chacun de nous peut agir. En participant \u00e0 des ramassages de d\u00e9chets pr\u00e8s de chez nous,  quand nous remontons de la plage, en \u00e9duquant nos enfants quant \u00e0 l\u2019importance de ce combat, en adh\u00e9rant \u00e0 des associations qui \u0153uvrent au quotidien ( @surfridereurope @cetasea_eu @seashepherd @pickitup40 ...) mais surtout en consommant \u00c9co-responsable !!!\nLes consommateurs ont le pouvoir de boycotter le plastique qui salit notre environnement....\n\nL\u2019eau c\u2019est la vie ... \ud83c\udf0a \n\nMerci @nomads_surfing pour les photos, rdv vendredi soir \u00e0 Bordeaux ..!!!\n.\n.\n#ocean #day #planet #conscience #ecolgy #oceanday #nature #children #ramassage #noplastic #beachlife #water #respect #together #love"}}]},"edge_media_to_comment":{"count":6},"comments_disabled":false,"taken_at_timestamp":1623148875,"edge_liked_by":{"count":506},"edge_media_preview_like":{"count":-1},"location":{"id":"231753044","has_public_page":true,"name":"Capbreton, Aquitaine, France","slug":"capbreton-aquitaine-france"},"thumbnail_src":"https://scontent-cdt1-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/197770084_381937479924409_6007162945563235530_n.jpg?tp=1&_nc_ht=scontent-cdt1-1.cdninstagram.com&_nc_cat=101&_nc_ohc=GuK3jzE0HIcAX_fW8XU&edm=AAWvnRQBAAAA&ccb=7-4&oh=1c7da3a06f08e6ce82b16e5d6dba91ab&oe=60D3001D&_nc_sid=e7738c","thumbnail_resources":[{"src":"https://scontent-cdt1-1.cdninstagram.com/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/197770084_381937479924409_6007162945563235530_n.jpg?tp=1&_nc_ht=scontent-cdt1-1.cdninstagram.com&_nc_cat=